CREATE TABLE CORP_TMP ( 
  CORP_NM      VARCHAR(60)
, ITEM_CD      VARCHAR(6)
, SECTOR       VARCHAR(100)
, MAIN_PROD    VARCHAR(300)
, LIST_DT      VARCHAR(8)
, SETTLE_MON   VARCHAR(2)
, REP_NM       VARCHAR(120)
, HOME_PAGE    VARCHAR(100)
, REGION       VARCHAR(40) 
);


create table corp_mst
as
select rownum as corp_no
     , c.*
  from corp_tmp  c
     , (select level as lvl from dual connect by level < 400) d
;

create index corp_mst_ix1 on corp_mst (corp_nm asc);

